import './Main.css'

import { Container } from "react-bootstrap";

function Main(){
    return(
        <div>
            <Container>
                <div className='mainContent'>
                    <h2>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Aliquam, iusto consequuntur eos voluptatem</h2>
                    <h4 className='text-muted'>Lorem ipsum dolor sit, amet consectetur adipisicing elit.</h4>
                </div>
            </Container>
        </div>
    )
}

export default Main
